import React,{useState} from 'react';
import logo from './logo.svg';
import './App.css';

import FetchKanji from './hooks/FetchKanji'

interface kanjiProps {
  kun_readings: string
}

function App() {
  const [state,setState]=useState({kun_readings: ""})
  const kanji: kanjiProps = FetchKanji("川")

  return (
    <div className="App">
      <input type="text" onChange={(event)=>setState(FetchKanji(event.target.value))} />

      {state.kun_readings}
    </div>
  );
}

export default App;
